// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract MyContract {

    address payable public seller;
    address payable public buyer;
    address public owner;

    uint256 public price;
    string public addr;
    uint public landArea;
    uint public numOfBedrooms;
    uint public numOfBathrooms;

    struct Property {
        address owner;
        uint256 price;
        string addr;
        uint landArea;
        uint numOfBedrooms;
        uint numOfBathrooms;
    }

    mapping (address => Property[]) public propertiesByOwner;

    event PropertyAdded(address indexed owner, uint256 price, string addr, uint landArea, uint numOfBedrooms, uint numOfBathrooms);

    constructor() {

        seller = payable(msg.sender);
        owner = seller;
        price = 1 ether;

        propertiesByOwner[owner].push(Property(owner, price, addr, landArea, numOfBedrooms, numOfBathrooms));

        emit PropertyAdded(owner, price, addr, landArea, numOfBedrooms, numOfBathrooms);
    }

    function buyRealEstate(address Owner, uint256 Price, string memory Addr, uint Area, uint Bedrooms, uint Bathrooms) external payable {
        require(msg.value == Price, "Incorrect payment amount");
        buyer = payable(msg.sender);
        seller.transfer(Price);
        Owner = buyer;

        propertiesByOwner[Owner].push(Property(Owner, Price, Addr, Area, Bedrooms, Bathrooms));

        emit PropertyAdded(Owner, Price, Addr, Area, Bedrooms, Bathrooms);
    }

    function transferOwnership(address newOwner) public {
        require(msg.sender == owner, "Only the owner can transfer ownership");
        owner = newOwner;
    }

    function getPropertiesByOwner(address _owner) public view returns (Property[] memory) {
        return propertiesByOwner[_owner];
    }

    function getCurrentBlockNumber() external view returns (bytes32) {
        uint256 blockNumber =  block.number;
        require(blockNumber > 0, "Cannot get hash of genesis block");
        return blockhash(blockNumber - 1);   
    }

}
